Text:
@AJWILLIKERS @KyleGarnerMO @JasonSmithMO Messaging is kind of the problem. Rural people listen when we run with the message "all rural people are stupid and racist" 

People don't vote for politicians that call them stupid. 

There's a generation of rural people that have only heard how awful Democrats think they are.

@chadsp70 @KyleGarnerMO People diminishing the work of rural activists is one reason why we can't get more support. 

Why step up to support something when the armchair activists are going to cut you down?

I'd invite you out to canvass, but you don't seem the type to actually do any work to help.

@KyleGarnerMO Again. You come knock some doors out here with me and I'll show you that you're wrong. 

Are there racists out here? Yes. Are all rural voters motivated by racism? No. 

Shoot me a DM and we can get coffee about it.

@KyleGarnerMO You'll get 0% of the rural vote by calling all rural people racist. Come to visit sometime and I can show you how wrong you are. 

Sincerely,

A rural Democrat.
